  //   };
  // }

  // componentWillMount(){}
  componentDidMount() {
    let headerCells = [], entry = StarWarsData.results[0];
    for (let k in entry) {
      headerCells.push(<th>{k}</th>);
    }
    const colHeaders = <tr>{headerCells}</tr>;

    this.setState({ 
      colHeaders: colHeaders,
      data: StarWarsData.results
    });
  }
  // componentWillUnmount(){}

  // componentWillReceiveProps(){}
  // shouldComponentUpdate(){}
  // componentWillUpdate(){}
  // componentDidUpdate(){}

  render() {

    const tableRows = this.state.data.map((entry) => {
      let tableCells = [];
      for (let k in entry) {
        if (k === "homeworld") {
          tableCells.push(<td key={k}><Homeworld api={entry[k]}/></td>);
        } else {
          tableCells.push(<td key={k}>{entry[k]}</td>);  
        }

      }
      return (<tr key={entry.name}>{tableCells}</tr>)
    })
console.log(this.state.colHeaders);
    return (
      <div>Use the Force!<br />
        <table>
          <thead>
            {this.state.colHeaders}
          </thead>
          <tbody>
            {tableRows}
          </tbody>
        </table>
      </div>
    );
  }
}

export default StarWarsDB;

